const aboutText = {
  professional:
  "Since 2020, I have been working in web development" 
  + "\n" 
  + "to advance and switch my career from teaching." 
  + "\n" 
  + "Since then, my main project was a career exploration" 
  +"\n"
  +"app (GoPuruse) that I built entirely from the ground up. \nPrior to this, I worked as a teacher for the past 10+ years. \nI have experience with JS, React, Ruby/Rails, Python/Django, \nand HTML/CSS.",
  personal:
    "I live in DC with my girlfriend and two dachshunds. \nIn my free time, I like to work on and listen <br>to music, exercise, and explore the city.",
};

export default aboutText;
